goog.provide("goog.net.CorsXmlHttpFactoryTest");goog.setTestOnly("goog.net.CorsXmlHttpFactoryTest");goog.require("goog.net.CorsXmlHttpFactory");goog.require("goog.net.IeCorsXhrAdapter");goog.require("goog.testing.jsunit");goog.require("goog.userAgent");function testBrowserSupport(){var requestFactory=new goog.net.CorsXmlHttpFactory;if(goog.userAgent.IE){if(goog.userAgent.isVersionOrHigher("10")){}else if(goog.userAgent.isVersionOrHigher("8")){assertTrue(requestFactory.createInstance()instanceof goog.net.IeCorsXhrAdapter);return}else{try{requestFactory.createInstance();fail("Error expected.")}catch(e){assertEquals("Unsupported browser",e.message);return}}}assertTrue(requestFactory.createInstance()instanceof XMLHttpRequest)}